import './App.css';
import 'bootstrap/dist/css/bootstrap.css'
import Navbar1 from "./components/Navbar1"
import Home from "./pages/Home"
import Algo2 from "./pages/Algo2"
import Bfa from "./pages/Bfa"
import Opkut from "./pages/Opkut"
import Login from "./pages/Login"

function App() {
  let Component
  switch (window.location.pathname) {
    case "/home":Component= <Home />
      break;
    case "/algo2":Component = <Algo2 />
      break
    case "/opkut":Component = <Opkut />
      break
    case "/bfa":Component = <Bfa />
      break
    case "/login":Component = <Login />
      break
  }



  return (

    <div className="App">
      <Navbar1/>
    </div>
  );
}

export default App;
